public int[] productExceptSelf(int[] nums) { // bigO(n^2) complexity
	int[] rv = new int[nums.length];
	
	for (int i = 0; i< rv.length; i++)
		rv[i] = 1;
	
	for (int i = 0; i <nums.length; i++) {
		for (int j = 0; j< rv.length; j++) {
			if (i==j)
				continue;
			rv[j] = nums[i]* rv[j];
		}
	}
	return rv;
}

public int[] productExceptSelf2(int[] nums) { // bigO(n*2) complexity  I didn't figure this out. I read the solution.  This is a medium!??
	int[] rv = new int[nums.length];
	
	rv[0] = 1;
	
	for (int i = 1; i< nums.length; i++)
		rv[i] = rv[i-1] * nums[i-1]; 
	
	int res = 1;
	for (int i = nums.length -1 ; i >=0; i--) {
		rv[i] = res*rv[i];
		res = res * nums[i];
	}
	return rv;
}



	
